      <p>Total Contacts: {stats.totalContacts}</p>
      <p>Total Phones: {stats.totalPhones}</p>
      <p>Newest Contact: {stats.newestContact}</p>
      <p>Oldest Contact: {stats.oldestContact}</p>
    </div>
  );
  }

export default Stats;
